import React from "react";
import { Carousel } from "react-bootstrap/";
import "bootstrap/dist/css/bootstrap.min.css";

const Poto = (props) => {
  return (
    <Carousel.Item>
      <img
        style={{ height: "10000px", width: "200px", padding: "200px" }}
        src={props.img}
        alt="first side"
      />
    </Carousel.Item>
  );
};

export default Poto;
